//Sort names in ascending order
let rep_streets = streets_2.sort();
//reference
let last_input = document.getElementById("input_2");
//Execute function on keyup
last_input.addEventListener("keyup", (e) => {
    //loop through above array
    //Initially remove all elements ( so if user erases a letter or adds new letter then clean previous outputs)
    removeElements_1();
    for (let i of rep_streets) {
        //convert input to lowercase and compare with each string
        if (
            i.toLowerCase().startsWith(last_input.value.toLowerCase()) &&
            last_input.value != ""
        ) {
            //create li element
            let listItem = document.createElement("li");
            //One common class name
            listItem.classList.add("list-items");
            listItem.style.cursor = "pointer";
            listItem.onclick = () => displayNames_1(i);
            // listItem.setAttribute("onclick", "displayNames('" + i + "')");
            //Display matched part in bold
            let word = "<b>" + i.substr(0, last_input.value.length) + "</b>";
            word += i.substr(last_input.value.length);
            //display the value in array
            listItem.innerHTML = word;
            document.querySelector(".list_1").appendChild(listItem);
        }
    }
});
function displayNames_1(value) {
    last_input.value = value;
    removeElements_1();
}
function removeElements_1() {
    //clear all the item
    let items = document.querySelectorAll(".list-items");
    items.forEach((item) => {
        item.remove();
    });
}